import data from "../dati/fantasy.json";

const FantasyBooks = ()=>{
    return(
        <Row>
            {data.map((book) => {
                return(

                        <Card className="MyCard">
                            <Card.Img variant="top" src={book.img} />
                            <Card.Body>
                                <Card.Title className="text-truncate">{book.title}</Card.Title>
                                <Card.Text>
                                    {book.author}
                                    <span class="badge bg-danger text-uppercase ms-2">{book.category}</span>
                                    <span class="ms-2">ASIN:{book.asin}</span>
                                </Card.Text>
                                <div className="d-flex justify-content-between">
                                <a href="#" class="btn btn-primary"><i class="bi bi-cart"></i>
                                </a>
                                <strong>â‚¬{book.price.toFixed(2)}</strong>
                                </div>
                            </Card.Body>
                        </Card>

                );
            })}
        </Row>


    );
}
export default FantasyBooks;
